import React, { Component } from 'react';

class ScrollText extends Component {
    render() {
        return (
            <div className="bar">
            <span className="bar_content">
              I am Will Hofkamp     I am a full stack developer     I am a chef
                    I am a gardener     I am a gardener     I am an innovator
                    I am a leader   I am a mobile app developer     I am a photographer
                    I am a learner      I am 
            </span>
            </div>
            )
        }
    }
    
export default ScrollText
